function Transactions() {
  return (
    <div className="container">

      <main className='container vertical-centre'>
          <div className='row left'>
              <h1 className='col border'>Recent transactions</h1>
          </div>

          <div className='row'>
              <h8 className='col'>Item</h8>
              <h5 className='col'>+ / -</h5>
              <h5 className='col'>Total</h5>
              <h5 className='col'>Minimum</h5>
          </div>

          <div className='row'>
              <p className='col'>a</p>
          </div>


      </main>




    </div>
  );
}

export default Transactions;
